INSERT INTO public.tbl_taxonomy_notes(taxonomy_notes_id, biblio_id, date_updated, taxon_id, taxonomy_notes) VALUES
(12818, 7766, '2020-03-13 13:32:14.1220000+01', 38932, E'http://www.bwars.com/index.php?q=ant/formicidae/formicinae/lasius-flavus'),
(12819, 7808, '2020-03-13 13:32:14.1300000+01', 31226, E'identified amongst the other British species by having a fine reticulation between the elytral punctures, by the lack of distinct bright orange longitudinal marks on the elytra, by the blackish antennae with paler basal segments, the lack of setae at the sides of the four basal abdominal segments, quadrate to elongate (rather than quadrate to transverse) antennal segments 6-10, the shape of the apex of the last abdominal tergite (which is similar to that of pallipes), the completely black pronotal front margin, the punctation of the pronotum and elytra being almost identical and a small ± well-defined reddish-yellow mark at the humeral angle of the elytra. The aedeagus is diagnostic but only by comparison with other Tachinus.'),
(12820, 7452, '2020-03-13 13:32:14.1330000+01', 35634, E'http://www.eakringbirds.com/eakringbirds2/insectinfocuschrysopsrelictus.htm'),
(12821, 7852, '2020-03-13 13:32:14.1370000+01', 46691, E'black and shining with yellow spots on head,  as C labiatus and C querceti; pair of creamy rather triangular spots on head are diagnostic.'),
(12822, 7766, '2020-03-13 13:32:14.1410000+01', 38940, E'http://www.bwars.com/index.php?q=ant/formicidae/formicinae/formica-rufa'),
(12823, 7846, '2020-03-13 13:32:14.1440000+01', 46672, E'known only from the type.'),
(12824, 7847, '2020-03-13 13:32:14.1470000+01', 30613, E'Key to separate from C incongruus.'),
(12825, 7766, '2020-03-13 13:32:14.1490000+01', 38931, E'http://www.bwars.com/index.php?q=ant/formicidae/formicinae/lasius-brunneus'),
(12826, 886, '2020-03-13 13:32:14.1520000+01', 31114, E'differs from simplicifrons in that on the pronotum the hindermost sublateral puncture lies in front of the larger side marginal puncture'),
(12827, 7766, '2020-03-13 13:32:14.1550000+01', 38942, E'http://www.bwars.com/index.php?q=ant/formicidae/formicinae/formica-pratensis'),
(12828, 7815, '2020-03-13 13:32:14.1580000+01', 35642, E'detailed description.'),
(12829, 7783, '2020-03-13 13:32:14.1610000+01', 30539, E'Photo at <https://bdj.pensoft.net/article/22788/element/2/3920605/>.'),
(12830, 7766, '2020-03-13 13:32:14.1660000+01', 38937, E'http://www.bwars.com/index.php?q=ant/formicidae/formicinae/lasius-emarginatus'),
(12831, 7837, '2020-03-13 13:32:14.1680000+01', 30453, E'shown to be a species complex.'),
(12832, 7335, '2020-03-13 13:32:14.1710000+01', 30613, E'records confused with C inconguus.'),
(12833, 7808, '2020-03-13 13:32:14.1760000+01', 31164, E'The genus can be distinguished by the raised border along the suture, the maxillary palp with a much narrower apical joint relative to the subapical segment and the antennal segments which are appreciably longer than in the closely-related Mycetoporus. It differs from I splendidum in being generally larger, with a less elongate head that lacks microsculpture on the dorsal surface and in the male, by the different arrangement of setae on the 5th and 6th sternites.'),
(12834, 7766, '2020-03-13 13:32:14.1800000+01', 38927, E'http://www.bwars.com/index.php?q=ant/formicidae/formicinae/lasius-platythorax'),
(12835, 7815, '2020-03-13 13:32:14.1840000+01', 35575, E'key to adults.'),
(12836, 7807, '2020-03-13 13:32:14.1870000+01', 46670, E'pronotum quadrate rather than elongate with no depressions on disk; temples poorly developed, 1/5 diameter of eye.'),
(12837, 4741, '2020-03-13 13:32:14.1900000+01', 32967, E'black with characteristic reddish brown kidney-shaped mark on each elytron'),
(12838, 7766, '2020-03-13 13:32:14.1940000+01', 38929, E'http://www.bwars.com/index.php?q=ant/formicidae/formicinae/lasius-alienus'),
(12839, 7766, '2020-03-13 13:32:14.1970000+01', 38926, E'http://www.bwars.com/index.php?q=ant/formicidae/formicinae/lasius-niger'),
(12840, 7808, '2020-03-13 13:32:14.2010000+01', 31237, E'T. rufipennis is identified by having a smooth ground between the elytral punctures and the combination of a black pronotum and entirely or nearly entirely bright red elytra.'),
(12841, 7827, '2020-03-13 13:32:14.2040000+01', 31058, E'Description of larva and pupa.'),
(12842, 7766, '2020-03-13 13:32:14.2080000+01', 38956, E'http://www.bwars.com/index.php?q=ant/formicidae/formicinae/formica-picea'),
(12843, 7808, '2020-03-13 13:32:14.2110000+01', 39732, E'This distinctive species exhibits the significantly narrowed abdomen typical of the Tachyporinae. It is further differentiated by the raised elytral border along the suture, by having the terminal segment of the maxillary palp of similar width to the sub-apical segment, as broad at its base as that segment and distinctly elongate, with the pronotum not entirely black and the elytra having at least one row of longitudinal punctures. From the closely superficial L lunulatus, it can be separated by size (8.0-10.8mm vs. 5.0-7.0mm), the colouration of the elytra (scutellum and base of elytra are orange) and the structure of the aedeagus.'),
(12844, 7842, '2020-03-13 13:32:14.2150000+01', 35575, E'Keys to larvae and adults.'),
(12845, 7783, '2020-03-13 13:32:14.2560000+01', 28917, E'photo at <https://bdj.pensoft.net/article/22788/element/2/3920587/>.'),
(12846, 7775, '2020-03-13 13:32:14.2590000+01', 34531, E'in contrast with P prasinus has yellow legs and antennae except club.'),
(12847, 7835, '2020-03-13 13:32:14.2620000+01', 36410, E'Key to genus.'),
(12848, 3780, '2020-03-13 13:32:14.2640000+01', 46638, E'has this as a separate sp., but subsp. In [Fauna Europea].'),
(12849, 7766, '2020-03-13 13:32:14.2670000+01', 38925, E'http://www.bwars.com/index.php?q=ant/formicidae/formicinae/lasius-fuliginosus'),
(12850, 7815, '2020-03-13 13:32:14.2720000+01', 35641, E'detailed description.'),
(12851, 7812, '2020-03-13 13:32:14.2750000+01', 46664, E'Description of new sp.'),
(12852, 3125, '2020-03-13 13:32:14.2770000+01', 39641, E'elytra black without microsculpture and bluish irridescent.'),
(12853, 7851, '2020-03-13 13:32:14.2800000+01', 33801, E'keys to C pusillus or C fulvus but distinguishable on rich orange colour of head and pronotum and black elytra with white stripe on outer intervals.'),
(12854, 7758, '2020-03-13 13:32:14.2820000+01', 46653, E'elytra with rows of strong strial punctures, the surface between smooth, pronotal side margins black, rarely narrowly yellowish or red anteriorly. Female has sutural line continued around apex of elytra.'),
(12855, 7766, '2020-03-13 13:32:14.2900000+01', 38934, E'http://www.bwars.com/index.php?q=ant/formicidae/formicinae/lasius-umbratus'),
(12856, 6834, '2020-03-13 13:32:14.2930000+01', 28906, E'https://baza.biomap.pl/en/taxon/species-carabus_menetriesi/photos_tx/tlpl/y'),
(12857, 7592, '2020-03-13 13:32:14.2970000+01', 35061, E'https://artfakta.artdatabanken.se/taxon/106394'),
(12858, 7808, '2020-03-13 13:32:14.3000000+01', 31225, E'T. bipustulatus is identified by having a fine reticulation between the elytral punctures, by the lack of distinct bright orange longitudinal marks on the elytra, by the reddish (rather than black) antennal base, the lack of setae at the sides of the four basal abdominal segments, quadrate to transverse (rather than quadrate to elongate) antennal segments 6-10, the shape of the apex of the last abdominal tergite, the colouration of the antennae which are typically entirely reddish or only very indistinctly pitchy towards their apices, the red to pitchy-red legs and a small ± well-defined reddish-yellow marks at the humeral angles of the elytra. The structure of the aedeagus is also useful, but only by comparison with other Tachinus.'),
(12859, 4741, '2020-03-13 13:32:14.3020000+01', 32959, E'Black, hind margin of elytra reddish brown and reddish brown margin to pronotum in male, legs  and tip of abdomen reddish brown'),
(12860, 6834, '2020-03-13 13:32:14.3050000+01', 31263, E'http://cassidae.uni.wroc.pl/Colpolon/deinopsis erosa.htm'),
(12861, 7766, '2020-03-13 13:32:14.3080000+01', 38943, E'http://www.bwars.com/index.php?q=ant/formicidae/formicinae/formica-exsecta'),
(12862, 7766, '2020-03-13 13:32:14.3110000+01', 38954, E'http://www.bwars.com/index.php?q=ant/formicidae/formicinae/formica-lemani'),
(12863, 7847, '2020-03-13 13:32:14.3140000+01', 30614, E'key to separate from C zealandicus.'),
(12864, 7758, '2020-03-13 13:32:14.3170000+01', 29872, E'pronotal lateral margins black, rarely reddish in parts.'),
(12865, 886, '2020-03-13 13:32:14.3200000+01', 31113, E'differs from molochinus in that on the pronotum the hindermost sublateral puncture lies behind the larger side marginal puncture, although the sublateral may occasionally be missing.'),
(12866, 7795, '2020-03-13 13:32:14.3220000+01', 29329, E'details of male genital characters.'),
(12867, 7758, '2020-03-13 13:32:14.3250000+01', 29874, E'Key.'),
(12868, 7766, '2020-03-13 13:32:14.3280000+01', 38915, E'http://www.bwars.com/index.php?q=ant/formicidae/dolichoderinae/tapinoma-erraticum'),
(12869, 7822, '2020-03-13 13:32:14.3300000+01', 46663, E'Description of new sp.'),
(12870, 7766, '2020-03-13 13:32:14.3340000+01', 38944, E'http://www.bwars.com/index.php?q=ant/formicidae/formicinae/formica-sanguinea'),
(12871, 7766, '2020-03-13 13:32:14.3360000+01', 38946, E'http://www.bwars.com/index.php?q=ant/formicidae/formicinae/formica-fusca'),
(12872, 7766, '2020-03-13 13:32:14.3380000+01', 38955, E'http://www.bwars.com/index.php?q=ant/formicidae/formicinae/formica-lugubris'),
(12873, 890, '2020-03-13 13:32:14.3410000+01', 31380, E'Key. Most British Isles specimens of brevipes are this sp.'),
(12874, 7452, '2020-03-13 13:32:14.3430000+01', 35575, E'http://www.eakringbirds.com/eakringbirds2/insectinfocuschloromyiaformosa.htm'),
(12875, 7775, '2020-03-13 13:32:14.3460000+01', 34524, E'no raised keel on external margin of tibiae, antennal scape reaches beyond rear margin of eye, legs dark with green scales.'),
(12876, 7864, '2020-03-13 13:32:14.3490000+01', 32248, E'http://www.coleoptera.org.uk/node/20605\r\n(Borowiec 2007)'),
(12877, 7452, '2020-03-13 13:32:14.3520000+01', 35641, E'http://www.eakringbirds.com/eakringbirds2/insectinfocushaematopotapluvialis.htm');
INSERT INTO public.tbl_text_biology(biology_id, biblio_id, biology_text, date_updated, taxon_id) VALUES
(67640, 7853, E'in ditches along dune slack.', '2020-03-13 13:30:29.7440000+01', 29573),
(67641, 7853, E'in carrion trap.', '2020-03-13 13:30:29.7560000+01', 33426),
(67642, 7798, E'in old grassland where it may be a pest.', '2020-03-13 13:30:29.7600000+01', 33572),
(67643, 7853, E'at roots of Lotus corniculatus on mobile dunes.', '2020-03-13 13:30:29.7630000+01', 34586),
(67644, 7853, E'on sallows, Salix spp, on coastal sand dunes and on Betula pendula, recorded from Salix repens and S caprea.', '2020-03-13 13:30:29.7650000+01', 35082),
(67645, 7271, E'See [Alexander 2019c].', '2020-03-13 13:30:29.7680000+01', 33627),
(67646, 7853, E'under logs and in grass tussocks and moss in damp dune slacks of fixed dunes.', '2020-03-13 13:30:29.7710000+01', 29257),
(67647, 7853, E'in debris in alder carr.', '2020-03-13 13:30:29.7740000+01', 30883),
(67648, 7853, E'in compost.', '2020-03-13 13:30:29.7770000+01', 30372),
(67649, 7853, E'in grass with ants.', '2020-03-13 13:30:29.7820000+01', 31037),
(67650, 4661, E'A widespread sp in grassland which is oligophagous on various legumes, Vicia, Lathyrus spp. Most host plants are abundant in Baden-Württemberg and occur in many habitats, from hedge to deciduous forest to grassland, grassland and grasslands, as well as ruderal tracts and extensive fields. Accordingly, the species is present in many biotopes. In earlier times the species was a pest on cultivated beans and peas.', '2020-03-13 13:30:29.7860000+01', 34739),
(67651, 7856, E'See [Alexander 2019c].', '2020-03-13 13:30:29.7890000+01', 33627),
(67652, 1013, E'(Faroe) on Calluna.', '2020-03-13 13:30:29.7950000+01', 34930),
(67653, 5054, E'on Calluna vulgaris, also above the treeline.', '2020-03-13 13:30:29.7990000+01', 34930),
(67654, 7853, E'in heaps of grass cuttings.', '2020-03-13 13:30:29.8020000+01', 31206),
(67655, 1480, E'in deciduous plantations, riparian forests, banks of rivers and pools. NE Europe: also bogs; Rhineland: also gardens. Littoral: dunes. Oligophagous on Salix spp, especially small leaved species and Populus spp.', '2020-03-13 13:30:29.8050000+01', 33801),
(67656, 7868, E'from burrows in sandy soil bank by river.', '2020-03-13 13:30:29.8090000+01', 30679),
(67657, 7849, E'by sieving fen litter and by sieving straw bales; from grassy upper saltmarsh and from dry ditches on coastal grazing marsh.', '2020-03-13 13:30:29.8120000+01', 30300),
(67658, 7853, E'in decaying fungi.', '2020-03-13 13:30:29.8170000+01', 31312),
(67659, 4741, E'In deciduous woodland, a specialised feeder on Phylloxeridae, mainly on Quercus. Abandance varies year to year depending on prey. Overwinters in bark crevices and under bark of oaks.', '2020-03-13 13:30:29.8210000+01', 32959),
(67660, 7853, E'occasional in carrion traps on fixed dunes.', '2020-03-13 13:30:29.8250000+01', 30145),
(67661, 7853, E'in carrion traps and pitfalls in slacks and fixed dunes, also on dead rabbit in pinewood.', '2020-03-13 13:30:29.8880000+01', 30073),
(67662, 7853, E'in old Salix sp.', '2020-03-13 13:30:29.8920000+01', 33672),
(67663, 7853, E'under seaweed and in carrion, on shore under driftwood; especially common in winter and early spring.', '2020-03-13 13:30:29.8960000+01', 30476),
(67664, 1480, E'especially in Fagus woods (Bohemia), bogs, especially on Poaceae, also in Sphagnum. Feeds on Calamogrostis and Dactylis spp.', '2020-03-13 13:30:29.9000000+01', 46703),
(67665, 7853, E'on sand dunes, often beneath seaweed, on foreshore beneath tidal debris; under dead seabird.', '2020-03-13 13:30:29.9030000+01', 33368),
(67666, 7853, E'in silty humus under Salix repens in a damp dune slack.', '2020-03-13 13:30:29.9060000+01', 31812),
(67667, 7853, E'under bark of Pinus, Populus and Alnus glutinosa, also under vegetation on mobile dunes.', '2020-03-13 13:30:29.9090000+01', 29458),
(67668, 1479, E'on sun-exposed grass steppe; dry lawns; dry grassy places and field margins; between grasses and stone rubble as well as under litter.', '2020-03-13 13:30:29.9130000+01', 46683),
(67669, 7853, E'under bark of Acer pseudoplatanus in deciduous woodland.', '2020-03-13 13:30:29.9170000+01', 30493),
(67670, 7853, E'on exposed sediments by river, streams and occasionally ponds.', '2020-03-13 13:30:29.9200000+01', 30720),
(67671, 7853, E'on shore.', '2020-03-13 13:30:29.9240000+01', 29234),
(67672, 7853, E'in fungi in pine woods.', '2020-03-13 13:30:29.9280000+01', 32484),
(67673, 7853, E'under bark of very decayed log of Quercus.', '2020-03-13 13:30:29.9400000+01', 33190),
(67674, 7853, E'on fixed dunes.', '2020-03-13 13:30:29.9430000+01', 32097),
(67675, 1393, E' in rotten plant material e.g. hay waste in barns, but occasionally in decaying trees, in bird''s nests or grass.', '2020-03-13 13:30:29.9470000+01', 30502),
(67676, 7853, E'adults and larvae abundant on plants of Asparagus officinalis in dunes, to which plants had spread from local cultivation.', '2020-03-13 13:30:29.9520000+01', 33766),
(67677, 7845, E'larvae develop in decaying, wet wood of deciduous trees, mainly in Quercus', '2020-03-13 13:30:29.9580000+01', 33327),
(67678, 7853, E'under log in alder carr and on sand of mobile dunes.', '2020-03-13 13:30:29.9750000+01', 28969),
(67679, 7787, E'Amongst marginal vegetation in pools, shallow ponds, lakes, rivers, streams with brackish waters. Case of plant fragments.', '2020-03-13 13:30:29.9840000+01', 37841),
(67680, 7775, E'flightless.', '2020-03-13 13:30:29.9970000+01', 34527),
(67681, 7798, E'in decaying vegetation and dung on dry, sandy or gravelly ground.', '2020-03-13 13:30:30.0060000+01', 33544),
(67682, 7853, E'associated with dung of rabbits, recorded as excavating short burrows into which it retreats in dry weather; also in rather dry horse dung..', '2020-03-13 13:30:30.0110000+01', 33479),
(67683, 7853, E'in fungi.', '2020-03-13 13:30:30.0170000+01', 31189),
(67684, 1480, E'in moderately dry cool places: woods and woodland margins as far as the dwarf tree zone, woodland meadows, stream and river riparian woodlands. Austria: also bogs and fir heaths. Polyphagous on shrubs and deciduous trees, often on Corylus avellana, singly on May shoots of Picea.  Feeding notches of the imagines on leaves.', '2020-03-13 13:30:30.0210000+01', 46700),
