(67693, 4661, E'on bogs and heathland of Ericaceae. The host plant is especially Calluna vulgaris with only a few specimens from Erica tetralix. The beetle appears in May and the larvae develop in the ovaries of the host plant [Hoffmann 1954], therefore egg laying follows in late July when the heather is in bloom. Pupation follows in the autumn in the ground.', '2020-03-13 13:30:30.0750000+01', 34930),
(67694, 7741, E'The larvae develop over 2-4 years and pupate in the wood of basal parts of living stems of aspen and of introduced Populus species, occasionally willow. It is said to prefer shaded stands of its host trees. A considerable amount of frass and wood fibre are ejected from the active tunnel entrances that are formed as an enlargement of the oviposition site. Scottish sites are typically aspen, birch and juniper stands on relatively fertile, well drained morainic deposits or steep sided river gorges [MacGowan & Begg 2002]. The circumference of inhabited trees were found to be within the range 13-187cm CBH, with a mean circumference of 47.4cm; the females were selecting for small trees, with thinner bark. The height of the tunnel entrances above ground level lay with the range 119cm, the mean being 7.19cm. Most tunnel entrances were found to be at the edge of the stand, next to open ground [MacGowan & Begg 2002]. Adult beetles are active mainly at dusk and at night; they are attracted to light. They feed on the leaves of you g aspens during July and August [Lindhe et al. 2010].', '2020-03-13 13:30:30.0800000+01', 33697),
