(67746, 3027, E'The stable fly, larvae in actively fermenting or decaying vegetative materials with or without nitrogenous waste, such as manure and urine. Recorded in Jordan as breeding under a layer of urine soaked goat manure in an enclosure. Often in straw used as animal bedding, but also in hay and silage. Densities of up to 28,000/sq m recorded from compact layers of hay. Also in coastal areas will breed in litter of aquatic grasses above waterline. In urban areas compost and grass cuttings also utilised for breeding. Adults of both sexes are obligate blood feeders, but will also feed on carbohydrates from flowers and plants and prefer livestock to poultry. In some areas prefers dogs, but will also feed on humans. A major pest of confined livestock leading to significant losses in productivity; 5 flies per animal seems an acceptalbe damage threshold. A major probable in dog kennels and in zoos seem to prefer the big cats. They are vectors in the transmission of cutaneous leishmaniosis, anthrax, brucellosis, equine infectious anaemia and bovine diarrhoea. An intermediate host for the spirurid nematode Habronema microstoma found in the stomach of horses. Development takes 12-13 days at 27 C, adults emerging from puparia after 7 days, and a blood meal is required before egg production. Imagines produce 60-800 eggs and live for up to 2 weeks. Generally a livestock pest, feeding below the knees and hocks of cattle and horses. They tend to cluster in localities such as dairies and stables rather than randomly seeking animals. In Norway overwintering takes place in heated animal houses as adults, but may also slow larval development over  winter in silage and on other substrates. Dispersal distances up to 225 km but more usually up to 5 km, and can survive for up to 19 days on pollen and honey.', '2020-03-13 13:30:30.2600000+01', 36656),
