(67814, 7808, E'Predatory, little is known about habitat preferencesin Britain. [Allen 1964] found it in ‘much decayed grass heaps’ and ‘under decomposing fish’ in his garden, ‘nearly always in late autumn; rare though occasionally in small numbers’ and in the ''wettest and most putrid part of compost heaps and heaps of decaying vegetation'' (P. Hammond pers comm.). It had also been observed at the sap of a Cossus-infested tree and in woodland localities. Along with other members of the genus, it was likely to be associated with decaying organic matter in general. Adults have been recorded in February, May, June and August - December.', '2020-03-13 13:30:30.4920000+01', 31226),
