(67827, 7741, E'[Rejzek 2006] described this species as perhaps Britain’s most difficult longhorn to find. The adults are short lived (about two weeks at most) and so precise timing is required. They appear when temperatures first exceed 20 C which has usually been towards the end of May or slightly later but is likely to change with climate change. It is thermophilous and consequently the preferred habitats are oaks growing on south facing slopes or sunny woodland edges. Especially attractive to the beetle are old stunted oaks with plenty of wounds and dead branches still attached to the living trees. The adults will sit on the leaves and in the late afternoon, when the temperature is high enough, they will fly quickly around the tree canopies. Only at this time can they be seen easily and captured on the wing. The adults hardly ever visit flowers. It is very polyphagous but oak is preferred; larvae feed in relatively moist red rotten wood in close contact with living tissue, such as the bases of dead branches surrounded by living callus development as the healthy tree produces fresh woody tissues around the wound. The pupal cell as well as the larval galleries are filled with typical long red wood fibres created by the larvae. The larvae develop for two to three years and pupate in the moist, rotten wood. [Rejzek 2006] also associates it with ‘ancient woodland’ although more strictly it is associated with veteran trees in relatively open situations such as woodland edges or open ride sides as well as ancient wood pastures and parklands in the past actively managed ancient woodlands might have provided suitable habitat but much ancient woodland has been abandoned through recent decades, partly through misguided hypotheses about minimum intervention being the best way of conserving their ecological processes. Minimum intervention management which results in closed canopy conditions would be disastrous to species such as this. In Britain the beetle is associated especially with oak but also cherry (Uhthoff-Kaufmann 1988], [Uhthoff-Kaufmann 1992a] [Uhthoff-Kaufmann 1997]. In Sweden the beetle is mostly restricted to elm species, rarely oak (Lindhe et al. 2010). The primary host tree in the Czech Republic (and probably in the UK) is oak, and to a lesser extent beech; elm is more important in Scandinavia. Sama (2002) says it is polyphagous on broadleaved trees, preferably Quercus, Populus, and Ulmus. The key heartwood decay fungi are presumably Laetiporus sulphureus (in oak and cherry) and Fistulina hepatica (oak) in Britain but Rigidoporus ulmarius (elm) in Sweden.', '2020-03-13 13:30:30.5350000+01', 33649),
