(67929, 7754, E'digs deep holes in sandy areas. The burrowing behaviour is basically different from that of other carabid beetles so far observed. When burrowing, unlike many other burrowing animals, no alternate motions are carried out by the deeply flattened foretibias. Instead, the tibiae are held beside the long mandibles and the broadly flattened underparts of the head which is bent downwards. In that manner a very large shovel-like area is built. By moving backwards the beetle carries all the sand out of his hole, which is behind the ‘shovel’.', '2020-03-13 13:30:30.8410000+01', 46642),
