(67939, 2079, E'Unlike the garden ant, L niger, the woodland ant occurs on fresh to moist soils, especially in woodlands and bogs. Nests more often planted in rotten wood, peat, grass stumps and the like. They are rarely built in mineral-rich soil and lack the mounds (or other above-ground structures) that are so typical of garden ants. In contrast, thin-walled structures, consisting of saliva and fungal hyphae, grown through with fungal organics, can occur in the interior of the nest. This ant is even more aggressive than L niger when defending the nest. Queens and males swarm during the same period of the year as L niger, late July to beginning of August.', '2020-03-13 13:30:30.8780000+01', 38927),
