(67951, 7808, E'typically associated with upland and montane moorland, heath, forest and fell. In lowland regions, it has been found in rough grassland and woodland. The beetle is associated specifically with carrion; grouse, gull and red deer (Cervus elaphus), but it is also found in other decaying organic matter including fungi. The adults and larvae are assumed to be predatory on other invertebrate larvae. Adults have been recorded between March and July and between September and November inclusive.', '2020-03-13 13:30:30.9130000+01', 31237),
