(68295, 7741, E'Larvae develop for 1-2 years and pupate in or under very dry bark of dead branches and stems of aspen (Ehnström 2007]; [Lindhe et al. 2010]. Occasionally in Salix, Rosa, Quercus [Bense 1995]. Adults often visit white flowers; found June and July [Kaufmann 1985]. Prefers drying aspen trees, exposed to the sun, about 15 20cm thick with thin bark. Larvae gnaw irregular, weaving galleries between bark and wood, eating mainly the bark when young but later the sapwood, where the galleries tend to be flat. Pupation usually at the end of a hook shaped chamber, 4 5cm long. Development usually 1 year but can last 2 years in cold summers [Palm 1959].', '2020-03-13 13:30:32.1440000+01', 33665),
