(68451, 1397, E'never in woodland, larvae exclusively in worked wood of conifers and deciduous trees. In Sweden, author only knows the sp from conifer railway (pine) sleepers in moist clay, near coast at Lomma (Skåne.). In Denmark, from deciduous wood, e.g. oak. Only from wet wood which does not dry out wood in stagnant moist earth or in water e.g. bridge piers, bathing huts, duck boards. Known in Sweden for its damage in dock areas but not to a great extent. Larva, pupae and adults in late June. Development a minimum of 2 yrs.', '2020-03-13 13:30:32.6040000+01', 33169),
