(68491, 2079, E'occurs on more or less open, sandy soil with sparse and short vegetation. Nests, which can extend more than one metre below the ground surface, have an extensive horizontal tunnel system in which the ants mainly move. Above ground, they are predominantly night active. Swarming takes place from the end of July and during August.', '2020-03-13 13:30:32.7290000+01', 38930),
