(68582, 7741, E'The eggs are laid on the smooth bark of twigs and slender stems of living healthy bushes, and the larva bores a straight gallery in the pith channel 30cm or more in length, or in sapwood in wider stems [Duffy 1953]. An accumulation of ejected frass clinging to the twigs is the only external indication that larvae are present [Shirt 1987] although [Lindhe et al. 2010] state that egg laying females gnaw halfway through the shoot, which causes characteristic wilting of the tops. Larvae develop for two years. The preferred host appears to be Salix spp, particularly Osier Salix viminalis. The pupa forms within the stem during the period June to September; imagines emerge in June and may be seen until September, the best month being August, especially if the weather is hot and sultry, when the beetles fly round the host tree above head height. Adults feed on the under side of Salix leaves [Lindhe et al. 2010]; a very wary beetle which hides beneath leaves when approached [Uhthoff-Kaufmann 1992c]. Nothing appears to have been documented about the situation of occupied host bushes, the density of bushes in the vicinity, whether open grown bushes or dense stands are preferred, age structure, etc, which makes conservation management impossible to determine.', '2020-03-13 13:30:33.1080000+01', 33702),
(68583, 7798, E'recorded from dog faeces.', '2020-03-13 13:30:33.1110000+01', 33448),
(68584, 7777, E'at sap exuding from Betula stump.', '2020-03-13 13:30:33.1140000+01', 32033),
(68585, 1479, E'on dry sandy ground; dry and warm slopes; steppe heath; stone quarries; dry weedy places; occasionally also in old parkland. With aphids on plants (Centaurea).', '2020-03-13 13:30:33.1170000+01', 46677),
(68586, 7853, E'common on both fixed and mobile sand dunes.', '2020-03-13 13:30:33.1200000+01', 29373),
