(68625, 1480, E'in deciduous woods, especially beechwoods and on woodland margins on damp ground. Polyphagous on autumn leaves, night active, in the daytime under stones and woodland litter, occasionally in wild food residues. Marginal feeding of adults on leaves and also on withered leaves.', '2020-03-13 13:30:33.2380000+01', 46702),
(68626, 7853, E'at edge of wet dune slack.', '2020-03-13 13:30:33.2410000+01', 34687),
(68627, 3125, E'in lowland to montane forests.', '2020-03-13 13:30:33.2440000+01', 29274),
(68628, 7853, E'in ditches by pools in damp slacks.and in snady soil by artificial scrape.', '2020-03-13 13:30:33.2470000+01', 29963),
(68629, 7853, E'occasionally on sand dunes.', '2020-03-13 13:30:33.2500000+01', 31160),
(68630, 7853, E'in sheep and cattle dung on dunes.', '2020-03-13 13:30:33.2530000+01', 33478),
