(68634, 7853, E'in deciduous woodland, in very dry dead branch of Populus x jackii and beaten from branches.', '2020-03-13 13:30:33.2650000+01', 34225),
(68635, 1480, E'in light mixed woodland with Abies and Fagus; light places and clearings in cold woodland. Polyphagous on herbs, especially on Senecio spp. Larvae feed on roots.', '2020-03-13 13:30:33.2680000+01', 46699),
(68636, 7787, E'Large streams and rivers; stoney substrate. Case of sand grains.', '2020-03-13 13:30:33.2700000+01', 37835),
(68637, 7853, E'sieved from grass tussock.', '2020-03-13 13:30:33.2730000+01', 31742),
(68638, 7842, E'in marshy localities and on damp woodland rides; may be abundant including coastal marshlands, numerous in boggy and upland areas. Seems to have a strong liking for human blood.', '2020-03-13 13:30:33.2760000+01', 35641),
(68639, 3023, E'in Calluna vulgaris flowers. Pupation in soil.', '2020-03-13 13:30:33.2790000+01', 34930),
(68640, 7741, E'The species develops in small and inconspicuous galls in living stems of aspen, willows, etc ., and the adult is very elusive, making the species difficult to detect by casual recorders. In stems of various broadleaved trees, most often birch and oak, but also wild apple, rowan, willow and alder, and pupate in the wood. Adults are nocturnal and feed on the leaves of the host trees', '2020-03-13 13:30:33.2820000+01', 33699),
(68641, 7853, E'in ditches and pools in dune slacks.', '2020-03-13 13:30:33.2850000+01', 29920),
(68642, 1397, E'habitat as Spindus dubius but also on Polyporus spp.', '2020-03-13 13:30:33.2880000+01', 33029),
(68643, 7853, E'in grassland, in moss, grass tuft and heaps of cut grass.', '2020-03-13 13:30:33.2910000+01', 30763),
(68644, 7853, E'flying and running on mobile sand dunes on warm days, April to October, remaining in burrows on cooler days.', '2020-03-13 13:30:33.2930000+01', 28887),
(68645, 7853, E'on Betula pendula.', '2020-03-13 13:30:33.2960000+01', 33796),
(68646, 1298, E'NOTE: records pre- 2010 are likely to include O vacca outside of England.', '2020-03-13 13:30:33.2990000+01', 33453),
(68647, 7798, E'on smaller animal carcases, once frequent on drying carcases on gamekeepers'' gibbets.', '2020-03-13 13:30:33.3020000+01', 30082),
(68648, 7853, E'in green mould under log of Pinus.', '2020-03-13 13:30:33.3050000+01', 32829),
