(68653, 7853, E'in most areas from deciduous woodland to mobile dunes, in litter, under stones and at plant roots.', '2020-03-13 13:30:33.3180000+01', 30937),
(68654, 7853, E'on fixed dunes and in alder carr.', '2020-03-13 13:30:33.3210000+01', 28929),
(68655, 7850, E'NOTE: pre-1995 records and several later ones refer to C incongruus.', '2020-03-13 13:30:33.3240000+01', 30613),
(68656, 2967, E'recorded from stored wheat, where it feeds on mites and larvae of other insects.', '2020-03-13 13:30:33.3260000+01', 31538),
(68657, 1478, E'in damp deciduous and mixed woodland, especially beechwoods (Fagetalia). Hanover: in conifer woodland. Hessen: sprucewoods. Montane: on clear felled areas. In rotting wood; under loose bark; in moss polsters.', '2020-03-13 13:30:33.3290000+01', 46639),
(68658, 7853, E'under bark of Pinus.', '2020-03-13 13:30:33.3320000+01', 30469),
