(68660, 7853, E'in grass tufts and decaying grass cuttings.', '2020-03-13 13:30:33.3370000+01', 31548),
(68661, 7853, E'littoral, on muddy and clayey shores under stones.', '2020-03-13 13:30:33.3400000+01', 29091),
(68662, 7835, E'larvae are internal parasites/predators of worms.', '2020-03-13 13:30:33.3430000+01', 36407),
(68663, 7853, E'in carrion trap on dunes.', '2020-03-13 13:30:33.3460000+01', 28902),
(68664, 7853, E'coastal, under seaweed, etc.', '2020-03-13 13:30:33.3490000+01', 28947),
(68665, 7803, E'See [Alexander 2019c].', '2020-03-13 13:30:33.3520000+01', 33665),
(68666, 7853, E'in heaps of cut grass and in rotting fungi.', '2020-03-13 13:30:33.3550000+01', 31230),
(68667, 7592, E'Lives underground in damp, vegetation-free sand and silty sand on shores of water bodies. The Swedish finds are made in gravel pits with ponds in the bottom. The species is found near the waterline and occurs mainly in places where the water has deposited some organic matter on the otherwise "sterile" mineral ground. Whether or not the species lives as a predator on all small springtails found in the sand, or if it lives on green algae in the sand, we do not know. The best way to capture this species, as well as several other species that live in a similar way, is to put the sand from the water surface around the puddles in a bowl of water and disturb the sand and observe all that floats on the surface of the water. This species floats because of its hairs high up on the water surface and quickly takes to the wing and disappears.', '2020-03-13 13:30:33.3580000+01', 30714),
(68668, 7853, E'in decaying fungi and heaps of cut grass.', '2020-03-13 13:30:33.3610000+01', 31361),
(68669, 7853, E'in pitfall trap in deciduous woodland.', '2020-03-13 13:30:33.3660000+01', 30121),
(68670, 7846, E'Added to British list and science from old thatch on house roof.', '2020-03-13 13:30:33.3690000+01', 46672),
(68671, 7798, E'in carrion, sometimes at light, mostly on light chalky or gravelly soils..', '2020-03-13 13:30:33.3740000+01', 30075),
(68672, 1480, E'in damp and swampy pastures; stream and river floodplains; copses; brick pits; damp woodland margins as far as the dwarf tree zone; also dry slopes, dunes, fir heaths. Westphalia: also sedge reed swamps. Brandenburg: bogs. Oligophagous on Mentha aquatica, Lycopus, Origanum, Salvia, Melissa, Nepeta and Glechoma spp; in winter singly in grass tussocks, moss and litter.', '2020-03-13 13:30:33.3780000+01', 33811),
(68673, 7853, E'in sheaves of cut Ammophila arenaria by dunes.', '2020-03-13 13:30:33.3800000+01', 31121),
(68674, 7853, E'under dead leaves in dune slack.', '2020-03-13 13:30:33.3830000+01', 30992),
(68675, 7853, E'from pine brash.', '2020-03-13 13:30:33.3860000+01', 32741),
(68676, 7853, E'in dunes and on road casualty cat.', '2020-03-13 13:30:33.3890000+01', 30014),
(68677, 7853, E'running on dead standing Alnus glutinosa with many borings.', '2020-03-13 13:30:33.3920000+01', 33323),
(68678, 7787, E'In small upland lakes (Wales); in lakes in central and northern Scotland and slow-flowing rivers in central Ireland. Case of mineral grains.', '2020-03-13 13:30:33.3940000+01', 37962),
(68679, 7798, E'in sheep dung on dry sandy or chalky soils.', '2020-03-13 13:30:33.3970000+01', 33481),
(68680, 7853, E'wind-blown on mobile dunes.', '2020-03-13 13:30:33.4000000+01', 30938),
(68681, 7853, E'under bark.', '2020-03-13 13:30:33.4030000+01', 30360),
(68682, 7787, E'Amongst submerged vegetation in permanent shallow ponds, pools and lakes, slow-flowing brooks and rivers. Case of leaf fragments e.g. Carex sp.', '2020-03-13 13:30:33.4060000+01', 46711),
(68683, 2485, E'xerophilous on light, sandy pine heaths, in mountains in dry sun-exposed conifer woods. Wing dimorphic.', '2020-03-13 13:30:33.4100000+01', 29451);
