(73857, 7741, '2020-03-13 13:16:44.6750000+01', E'England: very under recorded due to its habits; very few recorders are familiar enough with the species to be able to find it on demand, so a long history of under recording. Modern records from just three areas, old records more widely but including sites where might still be present. No information available on any\r\nthreats specific to known locations.', 33685),
(73858, 7870, '2020-03-13 13:16:44.6810000+01', E'Canada. a widely distributed Holarctic species found in the boreal forest areas N to the southern Arctic.', 30533),
(73859, 7741, '2020-03-13 13:16:44.6860000+01', E'England, Wales, Scotland: No perceived threats specific to this species. Originally a Scottish pine forest species; very widely introduced and established elsewhere but sparingly recorded; almost certainly under recorded due to association with pine forestry. Although only documented from 72 hectads between 1990 and 2017, there is reasonable confidence that exhaustive recording would find it in more than 100.', 33612),
