(73865, 7298, '2020-03-13 13:16:44.7140000+01', E'England: Leics, not recorded since 1943 and now considered to be extinct from the county following the clear-felling of Buddon Wood during the Second World War. Apart from an 18th century record from the Vale of Belvoir and the finding of a wing case in an owl pellet at Bradgate Park, only recorded from Buddon Wood 1855).', 28893),
