(74315, 7808, '2020-03-13 13:16:46.2480000+01', E'England: formerly scarce in S England N to Derbys, recorded from Devon, Dorset, Isle of Wight, S Hants, Surrey, W Kent, Middlesex, Hunts, Berks, Oxon, Cambs and Derbys. Most records pre-date 1918. The only officially accepted ''historical'' record thereafter is from the 1930''s from Windsor Forest, Berks. However, other possibly valid records come from Wimbledon Common, Surrey (1944), Savernake Forest, North Wiltshire (1945) and Wytham Wood, Oxon (1957) and require verification. Remarkably, it was rediscovered in Britain in 2018 when a male and female were found at a ''Cossus'' oak in Suffolk.', 31225),
