(74352, 7741, '2020-03-13 13:16:46.3730000+01', E'According to [Kaufmann 1991], the British distribution is centred on three distinct\r\nzones, one Highland Scotland, another ranging across central and northern England, and the third covering some Home Counties, East Anglia and the Fens. However, the mapping provided by [Twinn & Harding 1999] indicates two main centres: E England and Scottish Highlands, the English records appearing more as a single distribution pattern rather than two. The English range is centred on the fen district but the species has been recorded, albeit rarely and rather erratically, as far afield as Kent, W Wales, LancS and N Yorks. Most recent English records are from the fen district. An intensive study of the species in the Scottish Highlands was made in 2000 and 2001, as part of research into the saproxylic fauna of aspen [MacGowan & Begg 2002] the longhorn was found in 12 hectads.', 33697),
