(74392, 7638, '2020-03-13 13:16:46.4970000+01', E'England: native,nearly all the recorded localities are from the beaches of the Bristol Channel (in the widest sense) extending westwards to Broad Haven on the Pembroke coast and Bude on the N coast of E Cornwall, and reaching up the channel as far as Barry Island on the Glamorgan coast and Brean on the N Somerset coast. Further afield, the only other record is from Barmouth, Merioneth on 1st July 1913. In the post-1980 period, it has been recorded from 10 hectads in South Wales (in Pembrokes, Carmarthens and Glamorgan) and from just two hectads in SW England (Braunton Burrows and Berrow Dunes. Although regularly reported from Braunton Burrows throughout the latter half of the 20th century, it was last recorded there on 26th June 2002 and several coleopterists have reported its apparent absence where once it could be reliably found. The last record for Berrow was in 1994 where ''it is believed to have become extinct'' following council beach-cleaning operations [Duff & Boyce 2010]. There have been similar reports of the absence of E complanata from former sites in S Wales, including Pembrey Burrows, Kenfig and Crymlyn Burrows (all localities with post-1980 records) by coleopterists who had personally found the species easily and reliably at those sites in the past (Steve Bolchover and Steve McWilliam via the beetles-britishisles email group, August 2013). It is now therefore known from only seven locations and is declining fast. Monitoring of E complanata on the Castlemartin coast of Pembroke in 2007 failed to find the species at Freshwater West, another locality with post-1980 records, and recorded a population reduction of ''some concern'' at Frainslake Sands [Gibbs 2008]. On the east coast of Ireland, there appear to have been no records of E complanata since 2006 but here the absence of records may merely reflect an absence of survey effort (Roy Anderson, pers. comm., 2014). In Britain, there is an emerging picture of local extinctions throughout the species range corroborated by several different observers. A survey of all recent sites is required to establish the current distribution of this species.', 28933),
