(74410, 7741, '2020-03-13 13:16:46.5580000+01', E'England: primarily taken in a fairly circumscribed region N of the Thames, embracing Epping and Hainault Forests, besides some tracts of ancient wood, formerly the parklands of private estates: Wanstead Park and Dagnam Priory. It is from the Essex localities, Wanstead House in particular, that numbers were once found in some quantity. It has not recurred for about 60 years. Freely in a Kentish orchard, around the 1910s (Prof Theobald to AM Massee); near Brighton & Hastings [Kaufmann 1985]. A C European species extending as far west as SE England and N into S Sweden and Finland but more or less absent from the Medi terranean region [Bense 1995].', 33665),
