(74569, 7741, '2020-03-13 13:16:47.2320000+01', E'Largely confined in Britain today to the Speyside area of the eastern Highlands\r\n[Twinn & Harding 1999], but known from East Anglia long before it was discovered in the Highlands. East Anglian records are very sporadic, mostly refer to single specimens, and none have been reported to the various longhorn beetle recording schemes in the past  30 years or so.The lack of modern records from East Anglia suggest that the earlier records were the result of casual introductions and that it has never established that it established a self--maintaining population in the region. In contrast, it has occurred regularly when sought in Speyside for some 50 years (Allen 1972).The beetle is known throughout much of Europe although is sparse in western areas [Bense 1995]; widespread and common in the Nordic countries except close to mountains [Ehnström 2007].', 33640),
