(74628, 3761, '2020-03-13 13:16:47.4290000+01', E'Sweden.in old collections several specimens labelled Lapponia or Lapponia borealis, which are at least partly strictly Swedish finds. Only one certain locality  Tol Abisko. Norway only in the farthest N. Finland only in far N, mostly very rare.  Russia: only 3 localities on the Kola peninsula; also in neighbouring regions.  Circumpolar sp. in Europe outside the above areas, only on the Kanin peninsula and in the Petschora region. Siberia: E to Amur and Kamtschatska. N. America.', 28957),
