(74669, 7741, '2020-03-13 13:16:47.6350000+01', E'England: widespread in C and SE England. Despite having an apparently very small areal distribution (but greater than 2,000 km 2 ) there are no perceived threats, it is not considered severely fragmented, populations are not known\r\nto fluctuate and there is no reliable evidence of recent decline. The number of locations exceeds 10. The apparent decline in records almost certainly reflects under recording. The species develops in small and inconspicuous galls in\r\nliving stems of aspen, willows, etc., and the adult is very elusive, making the species difficult to detect by casual recorders. The recent records are thinly scattered across much of its known range so no range contraction is suspected.', 33698),
