(74779, 7741, '2020-03-13 13:16:48.1510000+01', E'Scotland: despite having an apparently very small distribution, there are no perceived threats, it is not considered severely fragmented, populations are not known to fluctuate and there is no reliable evidence of decline. The species is very under recorded due to its native range being the Caledonian pine forests. Many of the old hectads are outside of its native range and presumably reflect casual introductions.', 33691),
