(74786, 7741, '2020-03-13 13:16:48.2310000+01', E'England: despite having an apparently very small distribution, there are no perceived threats, populations are not known to fluctuate and there is no reliable evidence of a recent decline. Although only recorded from 8 hectads in\r\nthe period 1990-2018, these are from a wide area within the known range, and include sites where not previously known. It appears to have always been this rarely found. The data suggests a very elusive species. It is difficult to understand why its habitat in aerial dead, decaying thin branches might be under part icular threat at present.', 33655),
