(74794, 7741, '2020-03-13 13:16:48.2630000+01', E'Boreomontane. [Bense 1995] shows it as widespread across the boreal conifer forests of N Europe but more localized in montane conifer forests of C Europe from the Alps eastwards, with more isolated records from C France and the eastern Pyrenees. [Sama 2002] adds Siberia, eastward to Japan and mentions unconfirmed records from North America. Primarily known in the UK from the eastern most Caledonian pine forest relicts but [Twinn & Harding 1999] also show older records farther west. Also occasionally introduced at least temporarily to sites further S. Speyside has long been known as the core area for the British population but there are also records from Deeside and Tayside. The status of the species outside of Speyside is unclear as records tend to be one offs, in areas with no previous evidence for established populations.', 33646),
