(74815, 7808, '2020-03-13 13:16:48.3270000+01', E'Scotland; pre-1990 records from East Ross, Mid Perthshire, Clyde Isles, Midlothian and Dumfriess, but there are no post-1989 records.England: Cumberland, Lancs, Notts, E & W Gloucs, Worcs, Warwicks, Oxon, S Devon, S & N Somerset, Dorset, S Hants, Berks, E & W Sussex, E & W Norfolk, Northants, Cambs, N Essex, Surrey. The only post-1989 records are from Oxon (Shotover Hill, 2001), S Hants (Bignell Wood, 1999), W Sussex (Brandy Hole Copse, (between 2002 and 2005), W Norfolk (Cranwich Heath, 2009) and E Norfolk (Wheatfen Broad, 1997 and Sutton Fen, 2016). Wales: Denbighs, Pembrokes & Cardigan, the latter vice-county providing the sole post-1989 record (Creigiau Gwbert, 2003).', 31164),
