(75006, 3761, '2020-03-13 13:16:49.0960000+01', E'Sweden: S & C, on Bothnian coast continuous to Finnish border but rare in N & very local, in Fjeld mountains connected with those in Norway. Absent in Gotland, S coast of Skåne, around Malarsee, possibly E coast in Östergotland & N Småland. Norway: sparse but throughout S & C but uneven distribution; inland only 1 locality To N rarer but on coast to Swedish border. Russia: 4 localities  in Karelia, isolated records in W of Kola Peninsula. Denmark, including Bornholm, throughout not common; Estonia, Latvia. British Isles. A Palaearctic sp. in Europe S to NE France, Tirol, Transylvania, NE to Magar region in Russia, W Siberia & N Mongolia.', 28904),
(75007, 1479, '2020-03-13 13:16:49.1000000+01', E'C Europe: SE to Middle Elbe, Harz, Kassel and S Hanover.', 46673),
