(75012, 7533, '2020-03-13 13:16:49.1170000+01', E'Europe, E to SE Russia. In the Nordic region, this is one of the few species of dung beetles that is clearly spreading. Prior to 1975, it was regularly found only in Denmark and Fårö (N of Gotland), but more recently it has been found all over S Sweden - recently as far N as in Nynäshamn. Finland and Norway it is still absent.', 33489),
